import React from 'react'

const VideoItem = props => {    
    return(
        <div className = 'item'>
            <img src = {props.video.snippet.thumbnails.high.url} alt = {props.video.snippet.description} />
            {props.video.snippet.title}
        </div>
    );
}

export default VideoItem;
